import React from 'react';
import Link from 'next/link';

const NavBar = () => {
	return (
		<div>
			<ul>
				<li>
					<Link href="/">
						<a>Home</a>
					</Link>
				</li>
				<li>
					<Link href="/about">
						<a>About</a>
					</Link>
				</li>
			</ul>
			<style jsx>{`
			ul {
				background: #333;
				color: #fff;
				list-style: none;
				display: flex;
			}

			ul li {
				font-size
			}
			`}</style>
		</div>
	);
};

export default NavBar;
